import React from 'react';
import { StyledTable } from './styles';

export interface ITable {
  qualities: {
    quality: string;
    value: string;
  }[]
}

const Table: React.FC<ITable> = ({ qualities }) => {
  return (
    <StyledTable>
      {qualities.map((row)  => (
        <>
          <dt>{row.value}</dt>
          <dd>{row.quality}</dd>
        </>
      ))}
    </StyledTable>
  )
}

export default Table;
